using namespace std;

// 求两个数的最大公约数
// 6 18 -> 6
// 54 20 -> 2
// 默认数组是从小到大排序
int findMaxArraySameNum(vector<int> &v1, vector<int> &v2)
{
    int res;
    int i = 0, j = 0;
    while (i < v1.size() && j < v2.size())
    {
        if (v1[i] == v2[j])
        {
            res = v1[i];
            i++;
            j++;
        }
        else
        {
            if (v1[i] > v2[j])
            {
                j++;
            }
            else
            {
                i++;
            }
        }
    }
    return res;
}

/// @brief 找到一个数的所有除数
/// @param n 
/// @return 
vector<int> divisorNum(int n)
{
    vector<int> res;
    for (int i = 1; i <= n; i++)
    {
        if(n % i == 0)
        {
            res.push_back(i);
        }
    }
    return res;
}

int findMaxCommondivisor(int a, int b)
{
    vector<int> v1 = divisorNum(a);
    vector<int> v2 = divisorNum(b);
    int res = findMaxArraySameNum(v1, v2);
    return res;
}

