#include <bits/stdc++.h>
using namespace std;

void fillFactor(vector<int> &results, int num){
    for(int i = 1; i*i <= num; i++){
        if(num % i == 0){
        results.push_back(i);
        results.push_back(num / i);
        }
    }
}

int main(){
    int x, y;
    cin >> x >> y;

    vector<int> xFactors, yFactors;

    fillFactor(xFactors, x);
    fillFactor(yFactors, y);

    int gcd = 0;
    for(int i = 0; i < xFactors.size(); i++){
        for(int j = 0; j < yFactors.size(); j++){
            if(xFactors[i] == yFactors[j])
                gcd = max(gcd, xFactors[i]);
        }
    }
    cout << gcd << endl;
}

