#include <iostream>
using namespace std;

void swap(int* x,int* y){
    int tmp;
    tmp = *x;
    *x = *y;
    *y = tmp;
}

int gcd(int x,int y){
    int r;
    if(x < y)swap(&x,&y);
    while(y > 0){
        r = x % y;
        x = y;
        y = r;
    }

    return x;
}

