#include <iostream>
using namespace std;
int gcd_finder(int* a,int* b){
	if (*b == 0) {
		return *a;
	}
	else if (*a == *b) {
		return *a;
	}
	else if  (*a > *b) {
		int temp = *a % *b;
		*a = *b;
		*b = temp;
		return gcd_finder(a, b);
	}
	else {
		int temp = *b % *a;
		*b = *a;
		*a = temp;
		return gcd_finder(a, b);
	}
}
int main() {
	int a, b;
	std::cin >> a;
	std::cin >> b;
	if (a <= 0 || b <= 0) {
		return -1;
	}
	int result = gcd_finder(&a, &b);
	cout << result;
	return 0;
}

