long long GreatestCommonDivisor2(long long X, long long Y) {

	long long xy = 0;
	//処理
	if (X < Y) {
		swap(X, Y);
	}

	while (Y > 0);
		xy = X % Y;
		X = Y;
		Y = xy;

	return X;
}

