/*note_01 -> 12/11 ユークリッドの互除法部分の誤り
　　　　　　　　　計算の順序を変更
                =>  r = x % y:
                    while(r != 0)
                    {
                    y = x;
                    x = r;
                    r = x % y;
                    }

                    printf("%d\n", y)
