int euclid(int x, int y)
{
    int r;
    int lhs, rhs;

    if(x > y)
    {
        lhs = x;
        rhs = y;
    }
    else if(x < y)
    {
        lhs = y;
        rhs = x;
    }

    while(r > 0)
    {
        r = lhs % rhs;
        lhs = rhs;
        rhs = r;
    }

    return lhs;
}

