        lhs = y;
        rhs = x;
    }

    while(r > 0)
    {
        r = lhs % rhs;
        lhs = rhs;
        rhs = r;
    }

    return lhs;
}

int main()
{
    int x, y;

    std::cin >> x >> y;
    std::cout << euclid(x, y) << std::endl;
}

