int gcd(int x,int y){
    if (x < y){
        swap(x, y);
    }
    while(y > 0){
        int r = x % y;
        x = y;
        y = r;
    }
    return x;
}

int main()
{
    int x, y;
    cin >> x >> y;
    int r = gcd(x, y);
    cout << r << endl;
}

