template <typename T>
T binary_gcd(T a, T b) {
    T g = 1;
    while (a != 0 && b != 0) {
        g <<= ((1 ^ (a & 1)) & (1 ^ (b & 1)));
        a >>= (1 ^ (a & 1));
        b >>= (1 ^ (b & 1));
        if ((a - b) & 1) a = abs(a - b) >> 1;
    }
    return g * (a + b);
}

