int gcd(int a, int b)
{
    //if either value is zero then the gcd is the other value
    if (a == 0)
       return b;
    if (b == 0)
       return a;

    // if they are the same value then the value is their gcd
    if (a == b)
        return a;

    // if a is greater
    if (a > b)
        return gcd(a-b, b);
    return gcd(a, b-a);
}

