#include <iostream>

int main() {
    int x, y = 0;
    std::cin >> x >> y;

    int sub = x % y;
    int min = 0;
    if (x < y) {
        sub = y % x;
        y = x;
    }

    if (sub > y)
        min = y;
    else
        min = sub;

    int gcd = min;
    if (sub == 0) {
        std::cout << x << std::endl;
        return 0;
    }
    while ((sub % gcd != 0) || (y % gcd != 0)) {
        gcd--;
    }
    std::cout << gcd << std::endl;
    return 0;
}

