// 計算クラス
class Calc
{
public:
	//x,yの最大公約数を返す関数
	static int gcd(int x, int y)
	{

		//y <= x にする
		if (x < y)
		{
			int tmp;
			tmp = x;
			x = y;
			y = tmp;
		}

		//xがyの倍数の場合、最大公約数はyになるので計算終了
		if (x % y == 0)
		{
			return y;
		}
		// それ以外の場合、yとx%yの最大公約数を求める
		// yとx%yの最大公約数は、xとyの最大公約数に等しい(ユークリッドの互除法)
		else
		{
			return gcd(y, x % y);
		}
	}


};

