{
	// xとyを入力
	int x, y;
	Console::inputDataInt(x);
	Console::inputDataInt(y);

	// 計算結果を出力
	Console::outputResultInt(Calc::gcd(x, y));
	Console::outputResultChar('\n');

	return 0;
}

