int gdb(int x, int y) // greatest common divisor , x > y
{
    if (x % y == 0)
        return y;
    else if (x % y == 1)
        return 1;
    else
    {
        int a, b;
        if (x % y > y)
        {
            a = x % y, b = y;
        }
        else
        {
            a = y, b = x % y;
        }
        return gdb(a, b);
    }
    return -1; // result
}

