#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <ctype.h>

typedef struct bigint{
	int value[260] = {0};
	int length;
} BigInt;

void init(BigInt *A, char s[]){
	for(int i = 0; i < 260; i++){
		(A->value)[i] = 0;
	}
	int n = strlen(s);
	A->length = n;
	for(int i = 0; i < n; i++){
		(A->value)[i] = s[n - 1 - i] - '0';
	}
}

void printBigInt(BigInt *A){
	for(int i = A->length - 1; i >= 0; i--){
		printf("%d", (A->value)[i]);
	}
	printf("\n");
}

void setVal(BigInt *A, BigInt *B){  // A = B
	A->length = B->length;
	for(int i = 0; i < 260; i++){
		(A->value)[i] = 0;
	}
	for(int i = 0; i < B->length; i++){
		(A->value)[i] = (B->value)[i];
	}
}

void swap(BigInt *A, BigInt *B){
	BigInt *tmp = (BigInt*)malloc(sizeof(BigInt));
	char zero[2] = {'0', '\0'};
	init(tmp, zero);
	setVal(tmp, A);        // tmp = A
	setVal(A, B);			// A = B
	setVal(B, tmp);        // B = tmp
	free(tmp);
}

int isEven(BigInt *A){
	if((A->value)[0] % 2 == 0)
		return 1;
	return 0;
}

int isZero(BigInt *A){
	if(A->length <= 1 && (A->value)[0] == 0)
		return 1;
	return 0;
}

int less(BigInt *A, BigInt *B){
	if(A->length < B->length)
		return 1;
	if(A->length > B->length)
		return 0;
	for(int i = A->length - 1; i >= 0; i--){
		if((A->value)[i] < (B->value)[i]){
			return 1;
		}
		if((A->value)[i] > (B->value)[i]){
			return 0;
		}
	}
	return 0;
}

BigInt *max(BigInt *A, BigInt *B){
	if(less(A, B))
		return B;
	else
		return A;
}

BigInt *min(BigInt *A, BigInt *B){
	if(less(A, B))
		return A;
	else
		return B;
}

void multiply(BigInt *A, int c){
	int flag = 0;
	for(int i = 0; i < A->length; i++){
		int tmp = (A->value)[i] * c;
		tmp += flag;
		(A->value)[i] = tmp % 10;
		flag = tmp / 10;
	}
	if(flag > 0){
		(A->value)[A->length] = flag;
		(A->length)++;		
	}
}

void divideBy2(BigInt *A){
	multiply(A, 5);
	for(int i = 1; i < A->length; i++){
		(A->value)[i-1] = (A->value)[i];
	}
	(A->length)--;
	(A->value)[A->length] = 0;
}

void subtract(BigInt *A, BigInt *B){
	for(int i = 0; i < A->length; i++){
		if((A->value)[i] >= (B->value)[i]){
			(A->value)[i] -= (B->value)[i];
		}
		else{
			(A->value)[i+1] -= 1;
			(A->value)[i] += 10;
			(A->value)[i] -= (B->value)[i];
		}
	}
	while((A->value)[A->length-1] == 0)
		A->length--;
}

void add(BigInt *A, BigInt *B){
	if(less(A, B))
		swap(A, B);
	int flag = 0;
	for(int i = 0; i < A->length; i++){
		int tmp = (A->value)[i] + (B->value)[i];
		tmp += flag;
		(A->value)[i] = tmp % 10;
		flag = tmp / 10;
	}
	if(flag > 0){
		(A->value)[A->length] = flag;
		(A->length)++;		
	}
}

void power(BigInt *A, int n){
	for(int i = A->length - 1; i >= 0; i--){
		(A->value)[i+n] = (A->value)[i];
	}
	for(int i = 0; i < n; i++){
		(A->value)[i] = 0;
	}
	A->length += n;
}

void multiply2(BigInt *A, BigInt *B){
	BigInt *ans = (BigInt*)malloc(sizeof(BigInt));
	char zero[2] = {'0', '\0'};
	init(ans, zero);
	for(int i = 0; i < B->length; i++){
		BigInt *tmp = (BigInt*)malloc(sizeof(BigInt));
		init(tmp, zero);
		setVal(tmp, A);
		multiply(tmp, (B->value)[i]);
		power(tmp, i);
		add(ans, tmp);
		free(tmp);
	}
	setVal(A, ans);
	free(ans);
}

void GCD(BigInt *A, BigInt *B){
	BigInt *n = (BigInt*)malloc(sizeof(BigInt));
	BigInt *m = (BigInt*)malloc(sizeof(BigInt));
	BigInt *ans = (BigInt*)malloc(sizeof(BigInt));
	char zero[2] = {'0', '\0'};
	init(n, zero);
	init(m, zero);
	init(ans, zero);
	setVal(n, min(A, B));
	setVal(m, max(A, B));
	(ans->value)[0] = 1, ans->length = 1;
	while(isZero(n) == 0 && isZero(m) == 0){
		/*printBigInt(n);
		printf(" ");
		printBigInt(m);
		printf("\n");*/
		if(isEven(n) && isEven(m)){
			multiply(ans, 2);
			divideBy2(n);
			divideBy2(m);
		}
		else if(isEven(n)){
			divideBy2(n);
		}
		else if(isEven(m)){
			divideBy2(m);
		}
		if(less(m, n)){
			swap(n, m);
		}
		subtract(m, n);
	}
	multiply2(n, ans);
	printBigInt(n);
	//printf("\n");
	//printBigInt(ans);
}

