int gcd(int x, int y)
{
	int n, d;

	if (x >= y) {
		n = y;
	}
	else {
		n = x;
	}

	for (d = n; d >= 1; d--) {
		if (x % d == 0 && y % d == 0)
		{
			return d;
		}
	}
	return -1;
}

