#include <iostream>

int gcd(int a, int b) {
    // a が b より大きい場合は、a と b を入替える
    if (b > a) {
        std::swap(a, b);
    }

    while (b > 0) {
        // a と b の余りを計算する
        int r = a % b;
        // a と b を b と r に入替える
        a = b;
        b = r;
    }
    return a;
}

int main() {
    int x, y;
    std::cin >> x >> y;

    // 最大公約数を求める
    int gcd = gcd(x, y);

    std::cout << gcd << std::endl;
    return 0;
}

