// Function to find the GCD of two natural numbers a and b
int gcd(int a, int b)
{
    // Keep applying the Euclidean algorithm until the remainder is 0
    while (b != 0)
    {
        int r = a % b;
        a = b;
        b = r;
    }

    // The GCD is the last value of a
    return a;
}

