int mygcd(int x,int y){
  if (x >y) swap(x,y);
  while (y > 0){
    int r = x % y;
    x = y;
    y = r;
  }
  return x;
}

int main() {
  int x,y;
  cin >> x >> y;
  cout << mygcd(x,y) << endl;
}

