	if (a > b)
	{
		big = a;
		small = b;
	}
	else
	{
		big = b;
		small = a;
	}

	while (true)
	{
		long long amari = big % small;
		if (amari == 0)
		{
			return small;
		}
		big = small;
		small = amari;
	}
	return 0;
}

