//ユークリッドの互除法
//引数は2つの整数
int euclid(int x, int y) {
    if (x < y) {
        swap(x, y);
    }
    int remainder = x % y;
    if (remainder == 1) {
        return 1;
    }
    else if (remainder == 0) {
        return y;
    }
    else {
        return euclid(y, remainder);
    }
}

