    int sq = floor(sqrt(x));
    vector<int > l = primelist(sq);
    int m = 1;
    for(int i = 0;i<length(l);i++){
        if(x%l.at(i)==0){
            m*=l.at(i);
            x /= l.at(i);
        }
        if(x==1){break;}
    }
    return m;
}

vector<int > primelist(int x){
    vector<int > R = {2};
