//辗转相除法求最大公约数
int gcd(int x,int y){
    int r;//临时存储数字
    if(x<y) swap(x,y);
    while(y>0){
        r = x%y;
        x = y;
        y = r;
    }
    return x;
}

int main(){
    int x,y;
    scanf("%d %d",&x,&y);
    printf("%d\n",gcd(x,y));
    return 0;
}

#include <bits/stdc++.h>
using namespace std;

int calc_gcd(int x, int y){
    //base case
    if(x == 0){
        return y;
    }
    if(y == 0){
        return x;
    }

    //recursive step
    if(x >= y){
        return calc_gcd(y,x%y);
    }else{
        return calc_gcd(x,y%x);
    }
}


int main() {
  // ここにプログラムを追記
  int x;
  int y;
  cin >> x;
  cin >> y;
  cout << calc_gcd(x,y) << endl;
}

