#include <iostream>

using namespace std;

static int gcc(const int x, const y)
{
    int min, max;
    if (x >= y)
    {
        min = y;
        max = x;
    }
    else
    {
        min = x;
        max = y;
    }

    while (max > 0)
    {
        int r = min % max;
        min = max;
        max = r;
    }

    return min;
}

int main()
{
    int x, y;
    cin >> x >> y;

    int c = gcc(x, y);
    cout << c << endl;

    return 0;
}

