// 最大公約数を求める
int gcd(int x, int y)
{
	int max, min;
	if (x >= y) {
		max = x;
		min = y;
	}
	else {
		max = y;
		min = x;
	}

	// ユークリッド互除法で求める
	while (min != 0)
	{
		int tmp = min;
		min = max % min;
		max = tmp;
	}

	return(max);
}

