int gcd_euclid(int n, int m) {
  // Let n be the smaller number.
  if (n < m) {
    int tmp = m;
    m = n;
    n = tmp;
  }
  int r;
  while (m != 0) {
    r = n%m;
    n = m;
    m = r;
  }
  return n;
}

