struct UnionFind{
  /*
    unite(x,y) : x,yの木を併合
    same(x,y) : x,yの属する木が同じなら true
    siz(x) : xの属する木のサイズ
  */
  vece(par);
  vece(usiz); // usiz[i] : iを含む連結成分のサイズ
  UnionFind(ll n):par(n),usiz(n)
  {
    lp(i,n)
    {
       par[i]=i;
       usiz[i]=1;
    }
  }
  ll root(ll x)
  {
    if(par[x]==x) return x;
    return par[x]=root(par[x]);
  }
  void unite(ll x,ll y)
  {
    ll rx=root(x);
    ll ry=root(y);
    if (rx==ry) return;
    if (usiz[rx]>usiz[ry])
    {
      par[ry]=rx;
      usiz[rx]+=usiz[ry];
    }
    else
    {
      par[rx]=ry;
      usiz[ry]+=usiz[rx];
    }
  }
  bool same(ll x,ll y)
  {
    ll rx=root(x);
    ll ry=root(y);
    return rx==ry;
  }
  ll siz(ll x){return usiz[root(x)];}
};
