  return fac[n]*(finv[k]*finv[n-k]%mod)%mod;}
ll COM(ll n,ll k){
    if(n==k) return COMdp[n][k]=1;
    if(k==0) return COMdp[n][k]=1;
    if(k==1) return COMdp[n][k]=n;
    if(COMdp[n][k]) return COMdp[n][k];
    return COMdp[n][k]=COM(n-1,k)+COM(n-1,k-1);}
