vector<ll> prime_p(ll x){
    vector<ll> r;
    for(ll d=2;d*d<=x;d++)
    {
      if(x%d!=0)
        continue;
      ll ex=0;
      while(x%d==0)
      {
        ex++;
        x/=d;
      }
      pb(r,ex);
    }
    if(x!=1)
      pb(r,1);
    return r;
  }      // 素因数分解（～乗の部分のみ）
vector<ll> prime_a(ll x){
    vector<ll> r;
    for (ll a=2;a*a<=x;a++)
    {
      if(x%a!=0) continue;
      while(x%a==0) x/=a;
      pb(r,a);
    }
    if(x!=1) pb(r,x);
    return r;
  }      // 素因数分解（素因数を返すだけ）
vector<p_ii> prime(ll x){
    vector<p_ii> r;
    for (ll a=2;a*a<=x;a++)
    {
      if (x%a!=0) continue;
      ll ex=0;
      while(x%a==0)
      {
        ex++;
        x/=a;
      }
      pb(r,mp(a,ex));
    }
    if(x!=1) pb(r,mp(x,1));
    return r;}      // 素因数分解（…の～乗<pair>）
