#include <iostream>

int greater(int a, int b) {
    int min = std::min(a, b);
    int max = std::max(a, b);
    int result = 0;

    for (int i = 1; i <= min; i++) {
        if (min % i == 0 && max % i == 0) {
            result = i;
        }
    }

    return result;
}

