#include <iostream>
using namespace std;

int gcd(int x, int y) {
    int large, small, remainder;
    if (x >= y) {
        large = x;
        small = y;
    } else {
        large = y;
        small = x;
    }
    while ((remainder = large % small) > 0) {
        if (small >= remainder) {
            large = small;
            small = remainder;
        } else {
            large = remainder;
        }
    }
    return small;
}

