int gcd(int a,int b){
    int temp;
    if(a>b){
        if(a%b==0)
            return b;
        temp = gcd(b,a%b);
    }
    else{
        if(b%a==0)
            return a;
        temp = gcd(a,b%a);
    }
    return temp;
}
