#include <stdio.h>

void gcd(int N, int M){
    int s;

    if(N>M){
        for(int i=0; i<M; i++){
            if(N%i==0 && M%i==0){
                s = i;
                if(N%M==0){
                s = M;
                }
            }
        }
        printf("%d", s);
    }else if(N==M){
        s = N;
        printf("%d", s);
    }else{
        for(int i=0; i<N; i++){
            if(N%i==0 && M%i==0){
                s = i;
                if(M%N==0){
                s = N;
                }
            }
        }
        printf("%d", s);
    }

}

int main(){
    int N, M;
    scanf("%d　%d", &N, &M);

    gcd(N, M);

    return 0;
}

