/*xとyの値を交換する関数*/
void change(int x,int y){
    int z;
    z = x;
    x = y;
    y = z;
}

/*ユーグリット互除法で最大公約数を求める関数*/
int Greatest_Common_Divisor(int x,int y){
    int d;
    if(x < y){
        change(x,y);
    }
    while(y > 0){
        d = x % y;
        x = y;
        y = d;
    }
    return x;
}

