int gcd(int x, int y) {
  //整数 x, y について、x ≥ y ならば
  // x と y の最大公約数は y と x % y の最大公約数に等しい。
  //ここで x % y は x を y で割った余りである。　
  int ans;
  do {
    if (x >= y) {
      ans = y;
      x = x % y;
    } else {
      ans = x;
      y = y % x;
    }
  } while (x != 0 && y != 0);
  return ans;
}
int main() {
  int x, y;
  cin >> x >> y;
  cout << gcd(x, y) << endl;
  return 0;
}

