#include "bits/stdc++.h"
using namespace std;

int gcd(int *x,int *y){
    if(*x<*y){
        swap(*x,*y);
    }
    int r;
    while(*y > 0){
        r = *x%*y;
        *x = *y;
        *y = r;
    }
    return *x;  
}
