#include <iostream>

int yukurid( int &g, int &u )
{
    int &GE = g ;
    int &UE = u ;
    int Y = 0 ;
    Y = g % u ;

    if ( Y == 0 )
    {
        return u;
    }
    else
    {
        GE = UE ; UE = Y ;

        return yukurid( GE, UE ) ;
    }
}

int main(void)
{
    int a, b ;
    std::cin >> a >> b ;
    if ( a > b )
    {
        std::cout << yukurid( a, b ) << std::endl ;
    }
    else
    {
        std::cout << yukurid( b, a ) << "\n" ;
    }
    return 0 ;
}

