ll bubble(vector<pair<char, ll> > & data) {
	ll i, j,counter;
	pair<char, ll> v;
	ll Counter = 0;

	do{
		counter = 0;
		REP(i, SIZE(data) - 1) {
			v = data[i];
			if(data[i+1].second<v.second){
				data[i] = data[i + 1];
				data[i + 1] = v;
				counter++;
			}
		}
		Counter += counter;
	} while (counter > 0);
	return Counter;
}

ll selection(vector<pair<char, ll> >& data) {
	pair<char, ll> minv;
	ll minn;
	ll counter = 0;
	REP(i, SIZE(data) - 1) {
		minn = i;
		minv = data[i];
		FOR(j, i + 1, SIZE(data) - 1) {
			if (minv.second > data[j].second) {
				minv = data[j];
				minn = j;
			}
		}
		if (minn != i) {
			data[minn] = data[i];
			data[i] = minv;
			counter++;
		}
	}
	return counter;
}

