	vector<char> s1, s2;
	FOR(i, 1, 9) {
		REP(j, SIZE(data)) {
			if (i == data[j].second)s1.push_back(data[j].first);
			if (i == dataa[j].second)s2.push_back(dataa[j].first);
		}
	}
	if (s1 == s2) return true;
	else return false;
}

