int gcd(int a, int b)
{
	if (a % b == 0) return b;
	else if (b % a == 0) return a;
	int max = a > b ? a : b;
	int min = a < b ? a : b;
	return gcd(min, max % min);
}

int main()
{
	int a, b;
	cin >> a >> b;
	cout << gcd(a, b) << endl;
	return 0;
}

