#include<cstdio>

int div(int x, int y){
    int value;
    int count;
    if(x<y) count = x;
    else count = y;
    for(int i=1; i<=count; i++){
        if (x%i == 0 && y%i == 0){
            value = i;
        }
    }
    return value;
}

