int gcd(int x,int y){
    int mod,smallerNum;
    if(x>y){
        mod=x%y;
        smallerNum=y;
    }
    else{
        mod=y%x;
        smallerNum=x;
    }
    for(int i=smallerNum;i>0;--i){
        if(mod%i==0 && smallerNum%i==0){
            return i;
        }
    }
    return -1;
}

