int gcd(int x,int y){
    int larger,smaller;
    if(x>y){
        larger=x;
        smaller=y;
    }
    else{
        larger=y;
        smaller=x;
    }
    int mod,divided,divisor;
    divisor = smaller;
    divided = larger;
