// ヒント：X>=YにおいてGCD(Y,X%Y)とGCD(X,Y)は等しい。
// 入力　X,Y
// 出力　GCD(X,Y)
// 
// 1,入力値において大きい値をx,小さい値をyにならべかえる
// 2,x%y==0ならば終了。yを出力する。
// 3,x%yの値と、yの値を入力値として1に戻る。

#include<iostream>

int main(){

	long x, y, tmp;

	// Input
	std::cin >> x>>y;

	// Search

	for (;;) {
		if (x < y) {
			tmp = x;
			x = y;
			y = tmp;
		}

	// x>=yとなる。

		if (x % y == 0) break;

		x = x % y;
	}

	std::cout << y << std::endl;

	return 0;
}

