int search_GCD(int x, int y) //GCD = Greatest Common Divisor
{
    int tmp;

    if (x == y)
    {
        return x;
    }
    else if (x < y)
    {
        tmp = x;
        x = y;
        y = tmp;
    }

    tmp = x % y;

    while (tmp != 0)
    {
        x = y;
        y = tmp;
        tmp = x % y;
    }
    return y;
}

