int getGreatestCommonDivisor(int a, int b)
{
    int bigger   = a >= b ? a : b;
    int smaller  = a <= b ? a : b;
    int reminder = bigger % smaller;
    int gcd = 1;

    if (reminder == 0) return smaller;
    else
    {
        for (int i = reminder; i >= 2; i--)
        {
            if (bigger % i == 0 && smaller % i == 0)
            {
                gcd = i;
                break;
            }
        }
    }

    return gcd;
}

int main()
{
    int a, b;

    std::cin >> a >> b;

    std::cout << getGreatestCommonDivisor(a, b) << std::endl;
}

