{
    int bigger   = a >= b ? a : b;
    int smaller  = a <= b ? a : b;
    int reminder = bigger % smaller;
    int gcd = 1;

    if (reminder == 0) return smaller;
    else
    {
        for (int i = 2; i <= reminder; i++)
        {
            if (bigger % i == 0 && smaller % i == 0) gcd = i;
        }
    }

