class bigInt {
    private:
        vector<int> num;
    public:
        bigInt(string str) {
            for(int i=str.size()-1;i>=0;i--) {
                num.push_back(str[i]-'0');
            }
        }
		bool operator > (bigInt const &obj) {
			if(num.size() > obj.num.size())
				return true;
			else if(num.size() < obj.num.size())
				return false;
			else {
				for(int i=num.size()-1;i>=0;i--)
					if(num[i] > obj.num[i])
						return true;
					else if(num[i] < obj.num[i])
						return false;
				return false;
			}
		}
        bigInt operator - (bigInt const &obj) {
            bigInt res("");
            int lena = num.size(), lenb = obj.num.size();
            for(int i=0;i<lena;i++) {
            	if(i >= lenb) {
            		if(num[i] < 0) {
            			num[i+1] -= 1;
            			num[i] += 10;
            		}
            		res.num.push_back(num[i]);
            	}
            	else if(num[i] < obj.num[i]) {
            		num[i+1] -= 1;
            		num[i] += 10;
            		res.num.push_back(num[i]-obj.num[i]);
            		//printf("%d\n",num[i]-obj.num[i]);
            	}
          		else {
          			res.num.push_back(num[i]-obj.num[i]);
          		}
            }
            while(res.num.size() > 1 && res.num.back() == 0)
            	res.num.pop_back();
            return res;
        }
        bigInt operator * (bigInt const &obj) {
        	bigInt res("");
        	int lena = num.size(), lenb = obj.num.size();
        	for(int i=0;i<lena+lenb+1;i++)
        		res.num.push_back(0);
        	for(int i=0;i<lena;i++) {
        		for(int j=0;j<lenb;j++) {
        			res.num[i+j] += num[i]*obj.num[j];
        		}
        	}
        	for(int i=0;i<lena*lenb;i++) {
        		if(res.num[i] >= 10) {
        			res.num[i+1] = res.num[i]/10;
        			res.num[i] %= 10;
        		}
        	}
            while(res.num.size() > 1 && res.num.back() == 0)
            	res.num.pop_back();
            return res;
        }
        bigInt divide_by_2() {
        	bigInt res("");
        	int tmp = 0;
        	for(int i=num.size()-1;i>=0;i--) {
        		res.num.push_back((tmp*10+num[i])/2);
        		tmp = num[i]%2;
        	}
        	reverse(res.num.begin(), res.num.end());
        	while(res.num.size() > 1 && res.num.back() == 0) {
        		res.num.pop_back();
        	}
        	return res;
        }
        bool divisible_by_2() {
        	if(num[0]%2 == 0)
        		return true;
        	return false;
        }
        bool iszero() {
        	if(num.size() == 1 && num[0] == 0)
        		return true;
        }
		friend istream& operator >> (istream& in, bigInt &x);
        friend ostream& operator << (ostream& os, const bigInt& x);
};

ostream& operator << (ostream& os, const bigInt& x) {
	for(int i=x.num.size()-1;i>=0;i--)
		os << x.num[i];
    return os;
}

bigInt gcd_by_binary(bigInt A, bigInt B) {
	bigInt n(""), m(""), ans("1"), two("2");
	if(A > B)
		n = B, m = A;
	else
		n = A, m = B;
	cout << n << " " << m << endl;
	while(!n.iszero() && !m.iszero()) {
		cout << n << " " << m << endl;
		if(n.divisible_by_2() && m.divisible_by_2()) {
			n = n.divide_by_2();
			m = m.divide_by_2();
			ans = ans * two;
		}
		else if(n.divisible_by_2())
			n = n.divide_by_2();
		else if(m.divisible_by_2())
			m = m.divide_by_2();
		if(n > m)
			swap(n, m);
		m = m - n;
	}
	return ans * n;
}

