int MAX(int a,int b)
{
  int x;

  if(a<b)
    {
      x = a;
      a = b % a;
      b = x;
      if(a == 0) return b;
      else MAX(a,b);
    }

  else if(a>b)
    {
      x = b;

      b = a%b;

      a = x;

      if(b == 0)return a;
      else MAX(a,b);
    }
  else if(a == b) return b;
}

