int gcd(int x, int y){
    int r;
    // always must be x > y
    if (x < y) {
        swap(x,y);
    }
    // Euclidean Algorithm
    while (y > 0) {
        r = x % y;
        x = y;
        y = r;
    }

    return x;
}

