#include "bits/stdc++.h"
using namespace std;

int gcd(int a, int b)
{
  int n = 2;
  int max = a > b ? a : b;
  auto common_dividors = vector<int>{};

  for (auto n = 2; n < max; n++)
  {
    if (a % n == 0 && b % n == 0)
    {
      common_dividors.push_back(n);
    }
  }

  if (common_dividors.size() == 0)
  {
    return 1;
  }

  return common_dividors.at(common_dividors.size() - 1);
}

