using namespace std;

class cChoco {
public:
	string company;
	string name;
	double cacao;
	string location;
	double rating;

	cChoco(string company, string name, double cacao, string location, double rating) //コンストラクタ．このクラスの変数を生成した時に必ず呼び出される．コンストラクタの引数は，全て設定する必要があるため，コンストラクタを使えば値の設定し忘れを防ぐことができる．
	{
		this->company = company;
		this->name = name;
		this->cacao = cacao;
		this->location = location;
		this->rating = rating;
	}

	void show()
	{
		cout << "company:" << company << " name:" << name << " Cacao: " << cacao * 100 << "%" << endl;
	}

};

int main()
{
	//ファイルを開く
	ifstream ifs("chocolate-ratings.csv");

	//ファイルが開けなかった場合のエラー処理
	if (!ifs)
	{
		cout << "Error! File can not be opened" << endl;
		return 0;
	}

	vector<cChoco> vChoco;

	string  str;
	getline(ifs, str);//ヘッダーを読み飛ばす

	while (getline(ifs, str))//getline(ifs, str)　一行読み込み
	{
		//cout << str << endl; //一行ずつ表示

		string tmp[9];
		istringstream stream(str); //配列の個々のデータをストリームとして読み込む
		for (int j = 0; j < 9; j++) //ストリームデータを ,(カンマ)で区切ってtmpに入れる
		{
			if (!getline(stream, tmp[j], ',')) { // 区切られた文字がtmp[j]に入る
                          //getline 関数は最後の要素まで達した後に呼び出すと，戻り値に false を返す．
				break;
			}
		}
		cChoco oChoco(tmp[0], tmp[1], stod(tmp[4]) / 100, tmp[5], stod(tmp[6])); //必要なデータだけ選び，コンストラクタに設定．
		vChoco.push_back(oChoco); //配列を拡張
	}


	/*****  ここにソートのコードを記述する *****/
	int flag = 1;

	while (flag) {
		flag = 0;
		for (int w = 1795; w > 0; w--) {
			if (vchoco[w].cacao < vchoco[w - 1].cacao) {
				swap(vchoco[w - 1].cacao, vchoco[w].cacao);

				swap(vchoco[w - 1].company, vchoco[w].company);
				swap(vchoco[w - 1].name, vchoco[w].name);
				flag = 1;
			}
		}

	}


	//ファイル名を指定して，ファイル出力ストリームofsを指定したファイルを引数として作成する
	ofstream ofs("result.csv");

	//ファイルが開けない場合のエラー処理
	if (!ofs)
	{
		cout << "ファイルが開けませんでした．" << endl;
		cin.get();
		return 0;
	}

	for (int i = 0; i < vChoco.size(); ++i) {
		ofs << vChoco[i].company << ", " << vChoco[i].name << ", " << vChoco[i].cacao << endl;
	}

	return 0;
}

