#include <iostream>
#include <vector>
using namespace std;

int main(){
  long long AAA, BBB;
  long long AA = 1, BB = 1;
  long long A, B;
  cin >> AAA >> BBB;
  A = AAA;
  B = BBB;

  bool isDivA, isDivB;
  long long cur = 1;
  long long gd = 1;

  if (A<=B){
    if (B % A == 0) {
      cout << A << endl;
      return 0;
    } else if ( A % B == 0) {
      cout << B << endl;
      return 0;
    }
  }

  while (true){
    if (A % cur == 0){
      isDivA = true;
      A /= cur;
      AA *= cur;
    } else isDivA = false;

    if (B % cur == 0){
      isDivB = true;
      B /= cur;
      BB *= cur;
    } else isDivB = false;

    if (isDivA && isDivB) gd *= cur;

    //cout << cur << " " <<  A << ":" << AA << " " << B << ":" << BB << endl;
    if (cur * 2 > AAA || cur * 2 > BBB) break;

    if (isDivA == false && isDivB == false) cur++;
  	else if (cur == 1) cur++;
  }

  cout << gd << endl;
  return 0;
}

