#include <iostream>
using namespace std;

int Euclidean(int x, int y)
{
	int a, b;
	a = ((x > y) ? x : y);
	b = ((x < y) ? x : y);
	int q = a / b;
	int r = a % b;
	if (r == 0) {
		return b;
	}
	else
	{
		return Euclidean(b, r);
	}
}

