    int x, y; std::cin >> x >> y;
    std::cout << gcd(x, y) << std::endl;
}

#include <iostream>
#include <vector>

int main() {
	int x, y, min, gcd = 1;
	std::cin >> x >> y;
	min = x > y ? y : x;
	for (int i = 2; i <= min; i++)
		gcd = x % i == 0 && y % i == 0 ? i : gcd;
	std::cout << gcd << "\n";
	return 0;
}

