#include <iostream>
#include <vector>

int main() {
	int x, y, min, max;
	std::cin >> x >> y;
	x > y ? min = y : min = x;
	x < y ? max = y : max = x;
	x = min; y = max;
	while (x != 0) {
		y = y % x;
		x > y ? min = y : min = x;
		x < y ? max = y : max = x;
		x = min; y = max;
	}
	std::cout << y << "\n";
	return 0;
}

