void insertion_sort(int nums[100], int n){
    int p;
    for(int i=1; i<n; i++){
        p = nums[i];
        for(int j=0; j<i; j++){
            if(p<nums[j]){
                for(int k=i-1; k>=j; k--){
                    nums[k+1]=nums[k];
                }
                nums[j] = p;
                break;
            }
        }
        for(int i=0; i<n; i++){
            cout << nums[i];
            if(i<n-1){
                cout << " ";
            }else{
                cout << endl;
            }
        }
    }
}

