int gcd(int a, int b) {
    int n = (a < b) ? a : b;

    if(a % n == 0 && b % n == 0) {
        return n;
    }
    for(int i = n / 2 ; i > 0; --i) {
        if(a % i == 0 && b % i == 0) {
            return i;
        }
    }
}
