#include<stdio.h>
#include<stack>
#include<string.h>
#include<vector>
#include<algorithm>
using namespace std;

typedef struct S2_element {
    int position;
    int area;
}S2_element;

int main() {
    char s;
    int j, i=0, S=0, total_S=0;
    stack<int> S1;
    stack<S2_element> S2;
    S2_element s2;

    while (scanf("%c", s)!=EOF) {
        if (s=='\\') S1.push(i);
        else if (s=='/') {
            j = S1.top();
            S1.pop();
            S=i-j;
            total_S+=S;
            if (S2.empty()){
                s2.area = S;
                s2.position = j;
                S2.push(s2);
            } else {
                s2 = S2.top();
                if (s2.position > j) {
                    while (j > s2.position) {
                        S += s2.area;
                        S2.pop();
                        s2 = S2.top();
                    }
                }
                s2.area = S;
                S2.push(s2);
            }
        }
        i++;
    }
    printf("%d\n", total_S);

    vector<int> ans;
    while (S2.size() > 0) {ans.push_back(S2.top().area); S2.pop();}
    reverse(ans.begin(), ans.end());
    printf("%d", ans.size());
    for ( int i=0; i< ans.size(); i++) {
        printf(" %d", ans[i]);
    }
    printf("\n");

    return 0;
}

