int gcd(int x, int y)
{//precondition : 1 <= x,y <=10^9
    int a = max(x,y), b = min(x,y);
    //invariant : gcd(a,b) = gcd(x,y) && a >= b
    while(a != b && b!=0)
    {
        int tmp = a % b;
        a = max(tmp,b);
        b = min(tmp,b);
    }
    return a;
