int gcd(int x, int y) {
	// x%y==0になるまで続ける
	while(x%y!=0) {
		// あまり
		int z = x%y;
		// 数字入れ替え
		x = y;
		y = z;
	}

	// x%y==0なのでyが答え
	return y;
}

