void insertionSort(int A[],int N) {
	int i,j;
	for(i=1;i<N;i++){
		int v=A[i];
		j=i-1;
		while(A[j]>v && j>=0){
			A[j+1]=A[j];
			j--;
		}
		A[j+1]=v;
		print(A,N);
	}
}

