int GreatestCommonDivisor(int x, int y);

int main(void)
{
	int x, y;

	cin >> x >> y;

	printf("%d\n", GreatestCommonDivisor(x, y));

	return 0;
 }

// 最大公約数を求める関数
int GreatestCommonDivisor(int x, int y)
{
	int maxDivisor;

	if( x < y )
	{
		// x > y の関係になるようにする
		swap(x, y);
	}

	// --- yの約数を求める ---
	int j = 0;
	vector<int> divisor;

	// 1は必ず約数になる
	divisor.push_back(1);
	j++;

	for(int i = 2; i < (y / 2) + 1; i++)
	{
		if( y % i == 0 )
		{
			// 約数を格納する
			divisor.push_back(i);
		}
	}

	// y自身を約数として入れておく
	divisor.push_back(y);

	for(int i = divisor.size() - 1; i >= 0; i--)
	{
		if( x % divisor[i] == 0 )
		{
			// yの約数の中で値の大きいものから探索し, 最大公約数を見つける
			maxDivisor = divisor[i];
			break;
		}
	}

	return maxDivisor;
}

