int EuclidMethodOfDivision(int x, int y);

int main(void)
{
	int x, y;

	cin >> x >> y;

	printf("%d\n", EuclidMethodOfDivision(x, y));

	return 0;
 }

// 最大公約数を求める関数 ( ユークリッドの互除法 )
int EuclidMethodOfDivision(int x, int y)
{
	if( x < y )
	{
		// x > y の関係になるようにする
		swap(x, y);
	}

	// 割り算の余り
	int r;

	// ユークリッドの互除法で最大公約数を探索する
	while( y > 0 )
	{
		r = x % y;
		x = y;
		y = r;
	}

	return x;
}

