int gcd_func(int x,int y){
  int lrg,sml,remnant;
  if(x == y){
    return x;
  }else if(x > y){
    lrg = x;sml = y;
  }else{
    lrg = y;sml = x;
  }

  while(true){
    remnant = lrg % sml;
    if(remnant == 0){
      return sml;
    }
    lrg = sml;
    sml = remnant;
  }
}

