#include <iostream>

using namespace std;

int gcd(int a, int b) {
  if(a == b || a == 0) {
    return b;
  }
  if(!(a & 1) && !(b & 1)) {
    return gcd(a>>1, b>>1) << 1;
  }
  if((a & 1) && !(b & 1)) {
    return gcd(a, b>>1);
  }
  if(!(a & 1) && (b & 1)) {
    return gcd(a>>1, b);
  } else {
    if(a > b) {
      return gcd((a-b)/2, b);
    } else {
      return gcd((b-a)/2, a);
    }
  }
}

int main() {
  int x, y;
  cin >> x >> y;

  int res;
  res = gcd(x, y);

  cout << res << endl;

  return 0;
}

