//最大公約数を求める関数
int Greatest_Common_Divisor(int, int);
void Swap(int&, int&);

int main()
{
	int x, y;
	cin >> x >> y;

	cout << Greatest_Common_Divisor(x, y);

	return 0;
}

int Greatest_Common_Divisor(int x, int y) {
	int i;
	if(x < y) Swap(x, y);

	i = x % y;

	int t = i;

	while (i) {
		if (t % i == 0 && y % i == 0) {
			return i;
		}
		i--;
	}
}

void Swap(int &x, int &y) {
	int a;
	a = x;
	x = y;
	y = a;
}

