#include <iostream>

using namespace std;

int FindGcd(int x, int y) {
  if (y > x) {
    int swap = x;
    x = y;
    y = swap;
  }

  while (y > 0) {
    int r = x % y;
    x = y;
    y = r;
  }

  return x;
}

int main() {
  int x, y;
  cin >> x >> y;
  int ans = FindGcd(x, y);
  cout << ans << endl;
  return 0;
}

