int gcd(unsigned int x, unsigned int y){
  int tmp;
  // must x >= y
  if(x < y){
    tmp = x; x = y;y = tmp;
  }

  while (y != 0){
    tmp = y;
    y = x % y;
    x = tmp;
  }
  return x;
}

