int DivisorNumCount(int num){

  int tempcnt;

  tempcnt = 0;

  for ( int i = 1 ; i <= num ; i++){
    if(num % i == 0){
      tempcnt++;
    }
  }

  return tempcnt;
}

void Divisor(int *databuff,int num){

  int j;
  j = 0;

  for ( int i = 1 ; i <= num ; i++){
    if(num % i == 0){
      databuff[j] = i;
      j++;
    }
  }
}

void RetMaxDivisor(int leftnum,int* left,int rightnum,int *right){
  int maxdivisor;
  int leftcnt;
  int rightcnt;

  leftcnt = 0;
  rightcnt = 0;
  maxdivisor = 0;

  while((leftcnt < leftnum) && (rightcnt < rightnum)){
    if(left[leftcnt] == right[rightcnt]){
      maxdivisor = left[leftcnt];
      leftcnt++;
      rightcnt++;
    }else if(left[leftcnt] > right[rightcnt]){
      rightcnt++;
    }else if(left[leftcnt] < right[rightcnt]){
      leftcnt++;
    }else{
      //Nothing
    }
  }

  cout << maxdivisor << endl;
}

