int DivisorNumCount(int num){

  int tempcnt;

  tempcnt = 0;

  for ( int i = 1 ; i <= num ; i++){
    if(num % i == 0){
      tempcnt++;
    }
  }

  return tempcnt;
}

void Divisor(int *databuff,int num){

  int j;
  j = 0;

  for ( int i = 1 ; i <= num ; i++){
    if(num % i == 0){
      databuff[j] = i;
      j++;
    }
  }
}

