int
calcGCD(int x, int y)
{
    //printf("x : %d, y : %d\n", x, y);
    int bigger = 0, smaller = 0;
    if (x >= y) {
        bigger  = x;
        smaller = y;
    } else {
        bigger  = y;
        smaller = x;
    }

    if (bigger % smaller == 0) {
        return smaller;
    } else {
        return calcGCD(bigger % smaller, smaller);
    }
}

