int isState(int x, int y){
    if(x > y) return 1;
    else{
      if(x == y) return 0;
      else return -1;
    }
}

int gcd(int x, int y){
  int state = isState(x, y);
  if(state == 0) return x;
  else{
    if(state == 1) return gcd(x-y,y);
    else return gcd(x,y-x);
  }
}


