class GreatestCommonDivisor
{
 public:
  int solve( int a, int b );
};

int GreatestCommonDivisor::solve( int a, int b )
{
  while((a != 0) && (b != 0))
    {
      if (a > b)
        {
          a = a % b;
        }
      else
        {
          b = b % a;
        }
    }
  if (a == 0)
    return b;
  else
    return a;
}

int main( void )
{
  int a, b;

  GreatestCommonDivisor *greatestcommondivisor = new GreatestCommonDivisor();

  cin >> a >> b;

  cout << greatestcommondivisor -> solve( a, b ) << endl;

  delete greatestcommondivisor;

  return 0;
}

