#include <iostream>
using namespace std;

int gcd(int a, int b){
	int tmp;
	if (a < b){
		tmp = b % a;
		if (tmp == 0) return a;
		else gcd(a, tmp);
	}else{
		tmp = a % b;
		if (tmp == 0) return b;
		else gcd(b, tmp);
	}
}

int main(void){
	int a, b;
	cin >> a >> b;
	cout << gcd(a,b) << endl;
	return 0;
}

