/*
	For integers x and y, if 1 < y < x, then gcd(x, y) = gcd(y, x%y)
*/
int gcd (int x, int y )
{
	if (x % y == 0 ) return y;

	if (x < y ) swap (x, y );

	return gcd (y, x % y );
}

